import React, { useState, useEffect } from 'react';
import { useAuth } from '../../context/AuthContext';
import authService from '../../services/authService';
import './AdminPages.css';

const AdminDashboard = () => {
  const { user } = useAuth();
  const [stats, setStats] = useState({
    totalBranches: 0,
    totalUsers: 0,
    totalGames: 0,
    activeRentals: 0,
    todayRevenue: 0
  });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    loadDashboardStats();
  }, []);

  const loadDashboardStats = async () => {
    try {
      setLoading(true);
      setError('');
      
      // ÿ¨ŸÑÿ® ÿßŸÑÿ®ŸäÿßŸÜÿßÿ™ ŸÅŸä ŸàŸÇÿ™ Ÿàÿßÿ≠ÿØ
      const [branchesResponse, usersResponse, rentalsResponse] = await Promise.allSettled([
        authService.getBranches(),
        authService.getUsers(),
        authService.getActiveRentalsForCurrentBranch()
      ]);

      const newStats = {
        totalBranches: branchesResponse.status === 'fulfilled' && branchesResponse.value.success 
          ? branchesResponse.value.data.length : 0,
        totalUsers: usersResponse.status === 'fulfilled' && usersResponse.value.success 
          ? usersResponse.value.data.length : 0,
        totalGames: 0, // ÿ≥Ÿäÿ™ŸÖ ÿ™ÿ≠ÿØŸäÿ´Ÿá ŸÑÿßÿ≠ŸÇÿßŸã
        activeRentals: rentalsResponse.status === 'fulfilled' && rentalsResponse.value.success 
          ? rentalsResponse.value.data.length : 0,
        todayRevenue: 0 // ÿ≥Ÿäÿ™ŸÖ ÿ™ÿ≠ÿØŸäÿ´Ÿá ŸÑÿßÿ≠ŸÇÿßŸã
      };

      setStats(newStats);
    } catch (error) {
      setError('ÿ™ÿπÿ∞ÿ± ÿ™ÿ≠ŸÖŸäŸÑ ÿ•ÿ≠ÿµÿßÿ¶Ÿäÿßÿ™ ŸÑŸàÿ≠ÿ© ÿßŸÑÿ™ÿ≠ŸÉŸÖ');
      console.error('‚ùå ÿÆÿ∑ÿ£ ŸÅŸä ÿ™ÿ≠ŸÖŸäŸÑ ÿßŸÑÿ•ÿ≠ÿµÿßÿ¶Ÿäÿßÿ™:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="loading-container">
        <div className="spinner"></div>
        <p>ÿ¨ÿßÿ±Ÿä ÿ™ÿ≠ŸÖŸäŸÑ ŸÑŸàÿ≠ÿ© ÿßŸÑÿ™ÿ≠ŸÉŸÖ...</p>
      </div>
    );
  }

  return (
    <div className="admin-page">
      <div className="page-header">
        <h1>üìä ŸÑŸàÿ≠ÿ© ÿ™ÿ≠ŸÉŸÖ ÿßŸÑŸÖÿØŸäÿ±</h1>
        <p className="welcome-message">ŸÖÿ±ÿ≠ÿ®ÿßŸã ÿ®ŸÉÿå {user?.name}</p>
      </div>

      {error && (
        <div className="alert alert-error">
          {error}
        </div>
      )}

      {/* ÿ•ÿ≠ÿµÿßÿ¶Ÿäÿßÿ™ ÿ≥ÿ±Ÿäÿπÿ© */}
      <div className="stats-grid">
        <div className="stat-card">
          <div className="stat-icon">üè¨</div>
          <div className="stat-content">
            <h3>ÿßŸÑŸÅÿ±Ÿàÿπ</h3>
            <p className="stat-value">{stats.totalBranches}</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">üë•</div>
          <div className="stat-content">
            <h3>ÿßŸÑŸÖÿ≥ÿ™ÿÆÿØŸÖŸàŸÜ</h3>
            <p className="stat-value">{stats.totalUsers}</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">üéÆ</div>
          <div className="stat-content">
            <h3>ÿßŸÑÿ£ŸÑÿπÿßÿ®</h3>
            <p className="stat-value">{stats.totalGames}</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">‚è±Ô∏è</div>
          <div className="stat-content">
            <h3>ÿßŸÑÿ™ÿ£ÿ¨Ÿäÿ±ÿßÿ™ ÿßŸÑŸÜÿ¥ÿ∑ÿ©</h3>
            <p className="stat-value">{stats.activeRentals}</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">üí∞</div>
          <div className="stat-content">
            <h3>ÿ•Ÿäÿ±ÿßÿØÿßÿ™ ÿßŸÑŸäŸàŸÖ</h3>
            <p className="stat-value">{stats.todayRevenue} ÿ¨.ŸÖ</p>
          </div>
        </div>
      </div>

      {/* ÿ•ÿ¨ÿ±ÿßÿ°ÿßÿ™ ÿ≥ÿ±Ÿäÿπÿ© */}
      <div className="quick-actions">
        <h2>üîÑ ÿ•ÿ¨ÿ±ÿßÿ°ÿßÿ™ ÿ≥ÿ±Ÿäÿπÿ©</h2>
        <div className="actions-grid">
          <button 
            className="action-btn"
            onClick={() => window.location.href = '/admin/users'}
          >
            <span className="action-icon">üë•</span>
            <span className="action-label">ÿ•ÿØÿßÿ±ÿ© ÿßŸÑŸÖÿ≥ÿ™ÿÆÿØŸÖŸäŸÜ</span>
          </button>
          
          <button 
            className="action-btn"
            onClick={() => window.location.href = '/admin/branches'}
          >
            <span className="action-icon">üè¨</span>
            <span className="action-label">ÿ•ÿØÿßÿ±ÿ© ÿßŸÑŸÅÿ±Ÿàÿπ</span>
          </button>
          
          <button 
            className="action-btn"
            onClick={() => window.location.href = '/admin/rentals'}
          >
            <span className="action-icon">üìã</span>
            <span className="action-label">ÿπÿ±ÿ∂ ÿßŸÑÿ™ÿ£ÿ¨Ÿäÿ±ÿßÿ™</span>
          </button>
          
          <button 
            className="action-btn"
            onClick={() => window.location.href = '/admin/revenue-analysis'}
          >
            <span className="action-icon">üí∞</span>
            <span className="action-label">ÿ™ÿ≠ŸÑŸäŸÑ ÿßŸÑÿ•Ÿäÿ±ÿßÿØÿßÿ™</span>
          </button>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
